import React from 'react'
import { Link } from 'react-router-dom'
const LandingPage = () => {
  return (
    <div>
      <h1 className="text-4xl font-bold mb-6">PDF Tools</h1>
      {/* Navigation Links */}
      <div className="flex space-x-4 mb-8">
      <Link to="/dyslexicStudentPage" className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600">
        dyslexic students
      </Link>
      </div>
    </div>
  )
}

export default LandingPage
